import React from 'react';
import './styles.css'

export default function ShoppingList({name, items, size}) {
    return (
        <div>
            <h2>{ name }</h2>
            <h4>{size}kg</h4>
            <div>{items.join(', ')}.</div>
        </div>

    );
}
